function bindCheckIn(){var t=$(".plus-table").on("click",".fa-times",function(){1!==t.find("tbody tr").length&&$(this).closest("tr").remove()}).on("click",".fa-plus",function(){t.find("tbody").append('<tr>\n        <td>\n            <input type="text" name="option[checkin][day][]">\n        </td>\n        <td>\n            <input type="text" name="option[checkin][plus][]">\n        </td>\n        <td>\n            <i class="fa fa-times"></i>\n        </td>\n    </tr>')})}$(function(){$(".check-btn").click(function(t){t.preventDefault();var n=$(this),e=n.closest(".check-box");if(!e.hasClass("checked")){var c=n.data("toggle").split("|");postJson(n.attr("href"),function(t){200==t.code?(e.toggleClass("checked"),n.html(c[1]+"<em>已连续签到"+t.data.running+"天</em>")):parseAjax(t)})}})});